    <script>
        $(document).ready(function() {
            // Ховаємо всі блоки крім блоків країн
            $('.country-block, .company-cards, .vacancy-card, .details-btn').hide();

            $(document).on('click', '.country-card', function() {
                var countryId = $(this).data('country');

                // Ховаємо всі блоки крім блоків компаній в обраній країні
                $('.country-block').hide();
                $('#' + countryId).show();

                // Ховаємо всі блоки крім блоків компаній
                $('.company-cards').hide();

                // Показуємо блок компаній в обраній країні
                $('#' + countryId + ' .company-cards').show();

                // Ховаємо всі блоки вакансій та кнопок "Детальніше"
                $('.details-btn').show();
            });

            $(document).on('click', '.details-btn', function() {
                var index = $(this).data('index');

                // Ховаємо всі блоки вакансій
                $('.vacancy-card').hide();

                // Показуємо вакансії для обраної компанії
                $('.vacancy-card[data-index="' + index + '"]').show();
            });
        });

        function openPDFEditor(vacancyId) {
            document.getElementById('pdfEditorModalOverlay_' + vacancyId).style.display = 'block';
            document.getElementById('pdfEditorModal_' + vacancyId).style.display = 'block';
        }

        function closePDFEditor(vacancyId) {
            document.getElementById('pdfEditorModalOverlay_' + vacancyId).style.display = 'none';
            document.getElementById('pdfEditorModal_' + vacancyId).style.display = 'none';
        }


        function toggleMenu() {
            var menuContent = document.querySelector('.menu-content');
            if (menuContent.style.display === 'block' || getComputedStyle(menuContent).display === 'block') {
                menuContent.style.display = 'none';
            } else {
                menuContent.style.display = 'block';
            }
        }


        function saveChanges(vacancyId) {
            // Збираємо дані з форми
            var formData = {
                status: document.getElementById('statusInput_' + vacancyId).value,
                status: document.getElementById('statusInput_' + vacancyId).value,
                country: document.getElementById('countryInput_' + vacancyId).value,
                projectName: document.getElementById('projectNameInput_' + vacancyId).value,
                factorySpecialization: document.getElementById('factorySpecializationInput_' + vacancyId).value,
                workLocation: document.getElementById('workLocationInput_' + vacancyId).value,
                jobTitle: document.getElementById('jobTitleInput_' + vacancyId).value,
                genderAgeRestrictions: document.getElementById('genderAgeRestrictionsInput_' + vacancyId).value,
                shortDetails: document.getElementById('shortDetailsInput_' + vacancyId).value,
                productionChanges: document.getElementById('productionChangesInput_' + vacancyId).value,
                workingHours: document.getElementById('workingHoursInput_' + vacancyId).value,
                salary: document.getElementById('salaryInput_' + vacancyId).value,
                accommodationConditions: document.getElementById('accommodationConditionsInput_' + vacancyId).value,
                mealConditions: document.getElementById('mealConditionsInput_' + vacancyId).value,
                transportation: document.getElementById('transportationInput_' + vacancyId).value,
                additionalExpenses: document.getElementById('additionalExpensesInput_' + vacancyId).value
                // Додайте інші поля форми за аналогією
            };

            // Виконуємо AJAX-запит для відправки даних
            axios.put("{{ url('project/update') }}/" + vacancyId, formData)
                .then(function(response) {
                    // Обробляємо успішну відповідь від сервера
                    console.log('Зміни збережено успішно');
                    // Додайте код для відображення повідомлення про успішне збереження або інші дії після успішного збереження
                })
                .catch(function(error) {
                    // Обробляємо помилку під час відправки запиту
                    console.error('Сталася помилка під час збереження змін:', error);
                    // Додайте код для відображення повідомлення про помилку або інші дії у випадку помилки
                });
        }



