                var fileReader = new FileReader();
                fileReader.onload = function() {
                    var typedarray = new Uint8Array(this.result);
                    pdfjsLib.getDocument(typedarray).promise.then(function(pdf) {
                        return pdf.getPage(1);
                    }).then(function(page) {
                        var viewport = page.getViewport({
                            scale: 1.0
                        }); // Збільшення масштабу до 200%
                        canvas.height = viewport.height;
                        canvas.width = viewport.width;
                        var renderContext = {
                            canvasContext: canvas.getContext('2d'),
                            viewport: viewport,
                            renderInteractiveForms: true,
                            progressiveLoad: true, // Прогресивне завантаження
                            textLayer: true,
                            // Відображення шару зображень
                            useOnlyCssZoom: true
                        };
                        page.render(renderContext);
                    });
                };
                fileReader.readAsArrayBuffer(blob);
            }, {
                imageQuality: 2.0 // Встановлюємо максимальну якість зображення
            });



        }

        function saveAsPNG(vacancyId) {
            var pdfContainer = document.getElementById(`pdfContainer_${vacancyId}`);
            var canvas = document.createElement('canvas');
            canvas.width = pdfContainer.offsetWidth * 2; // масштабуємо ширину і висоту у два рази для кращої якості
            canvas.height = pdfContainer.offsetHeight * 2;
            var context = canvas.getContext('2d');
            context.scale(2, 2); // масштабуємо контекст канваса

            html2canvas(pdfContainer, {
                useCORS: true,
                allowTaint: true,
                logging: true,
                onrendered: function(canvas) {
                    var imageData = canvas.toDataURL('image/png');

                    // створюємо посилання для завантаження
                    var downloadLink = document.createElement('a');
                    downloadLink.href = imageData;
                    downloadLink.download = `vacancy_${vacancyId}.png`;
                    document.body.appendChild(downloadLink);
                    downloadLink.click();
                    document.body.removeChild(downloadLink);
                }
            });
        }



